on pages</li>\n        </ul>\n        <h4>Version 1.4.8 - Released: Nov 17, 2016</h4>\n        <ul>\n			<li>Added: Filter ''yith_wcas_search_for_taxonomy'' to extend the search to other taxonomies</li>\n			<li>Added: A new template to show page-wide search form</li>\n			<li>Added: A class in the body to add specific css rules for big themes</li>\n			<li>Tweak: Shortocode [yith_woocommerce_ajax_search] added attribute ''template'' and ''class''</li>\n        </ul>\n        <h4>Version 1.4.7 - Released: Oct 19, 2016</h4>\n        <ul>\n            <li>Fixed: Ajax call for some themes that override yith-woocommerce-ajax-search.php template</li>\n        </ul>\n        <h4>Version 1.4.6 - Released: Oct 17, 2016</h4>\n        <ul>\n            <li>Added: Option to save the autocomplete results in a transient</li>\n            <li>Fixed: Search by SKU in product_variation</li>\n        </ul>\n        <h4>Version 1.4.5 - Released: Aug 03, 2016</h4>\n          <ul>\n            <li>Added: Search by vendor</li>\n            <li>Tweak: Search by sku</li>\n            <li>Fixed: Badge Out of Stock</li>\n            <li>Updated: Plugin Framework</li>\n          </ul>\n        <h4>Version 1.4.4 - Released: Jun 17, 2016</h4>\n          <ul>\n            <li>Fixed: Error occurred in the search</li>\n\n          </ul>\n\n          <h4>Version 1.4.3 - Released: Jun 11, 2016</h4>\n          <ul>\n            <li>Fixed: Error occurred in the search</li>\n            <li>Updated: Plugin Core Framework</li>\n          </ul>\n		  <h4>Version 1.4.2 - Released: Jun 10, 2016</h4>\n          <ul>\n			<li>Added: Support to WooCommerce 2.6 RC1</li>\n			<li>Updated: Plugin Core Framework</li>\n          </ul>\n\n          <h4>Version 1.4.1 - Released: jun 07, 2016</h4>\n          <ul>\n            <li>Added: Italian Translation</li>\n            <li>Added: Spanish Translation</li>\n          </ul>\n\n\n          <h4>Version 1.4.0 - Released: Mar 29, 2016</h4>\n          <ul>\n            <li>Fixed: View All link javascript issue</li>\n          </ul>\n\n          <h4>Version 1.3.9 - Released: Mar 15, 2016</h4>\n          <ul>\n            <li>Added: Output Option to show product category on autocomplete result</li>\n            <li>Added: Order by post type option</li>\n            <li>Updated: Plugin Core Framework</li>\n            <li>Fixed: Duplicated in search by sku</li>\n          </ul>\n\n          <h4>Version 1.3.8 - Released: Jan 08, 2016</h4>\n          <ul>\n            <li>Added: Compatibility with WooCommerce 2.5 RC1</li>\n            <li>Added: Compatibility with Wordpress 4.4.x</li>\n            <li>Added: Option to change ''No results'' text</li>\n            <li>Updated: Plugin Core Framework</li>\n          </ul>\n\n        	<h4>Version 1.3.7 - Released: Oct 29, 2015</h4>\n        	<ul>\n				<li>Updated: Plugin Core Framework</li>\n			</ul>\n\n			<h4>Version 1.3.6 - Released: Oct 23, 2015</h4>\n            <ul>\n				<li>Added: A filter to change the taxonomy terms ''yith_wcas_search_taxonomy_terms''</li>\n				<li>Updated: Changed Text Domain from ''yit'' to ''yith-woocommerce-ajax-search''</li>\n				<li>Updated: Plugin Core Framework</li>\n				<li>Fixed: Problem with more ajax search widget on a page</li>\n				<li>Fixed: Query search after click "view all" or submit the search form</li>\n				<li>Fixed: Issue with Woocommerce Product Widget</li>\n			</ul>\n\n		<h4>Version 1.3.5 - Released: Aug 19, 2015</h4>\n            <ul>\n				<li>Fixed: Minor bug</li>\n			</ul>\n         <h4>Version 1.3.4 - Released: Aug 12, 2015</h4>\n            <ul>\n				<li>Added: Support to WooCommerce 2.4.2</li>\n				<li>Updated: Plugin Core Framework</li>\n			</ul>\n\n        <h4>Version 1.3.3 - Released: Jul 29, 2015</h4>\n        <ul>\n            <li>Added: WooCommerce Badge for Out of Stock products</li>\n            <li>Added: Option to search in custom field</li>\n            <li>Added: Italian Translation</li>\n            <li>Updated: Extend the reserch to product tag and category when post type is "all"</li>\n            <li>Fixed: Called to WP_Widget construct</li>\n            <li>Fixed: Sort by price in shop results</li>\n            <li>Fixed: Support WPML</li>\n        </ul>\n\n        <h4>Version 1.3.2 - Released: Jun 15, 2015</h4>\n        <ul>\n            <li>Fixed: Backward compatibility with Autocomplete function</li>\n        </ul>\n\n        <h4>Version 1.3.1 - Released: Jun 10, 2015</h4>\n        <ul>\n          <li>Updated: Renamed Autocomplete function with YithAutocomplete</li>\n        </ul>\n\n        <h4>Version 1.3.0 - Released: Apr 24, 2015 </h4>\n        <ul>\n          <li>Added: Wordpress 4.2 compatibility</li>\n          <li>Added: Multiple Word Search Option</li>\n          <li>Fixed: Shorcode output</li>\n          <li>Fixed: Wp security issue</li>\n		    </ul>\n\n        <h4>Version 1.2.7 - Released: Apr 07, 2015 </h4>\n        <ul>\n          <li>Added: Extended the research on page if element types of search is "all"</li>\n          <li>Added: Setting option to choose element types to search</li>\n          <li>Fixed: Research by sku variation bug</li>\n        </ul>\n        <h4>Version 1.2.6 - Released: Mar 30, 2015 </h4>\n        <ul>\n            <li>Added: Option to disable direct redirect when search string and results matches</li>\n            <li>Added: Option to hide featured badge if the product is on sale</li>\n            <li>Added: Link "View All" at the bottom of autosuggested results</li>\n            <li>Added: Option to change color to title</li>\n            <li>Added: Option to change thumbnail size</li>\n            <li>Updated: Plugin Core Framework</li>\n            <li>Fixed: Disabled submit when search string is empty</li>\n            <li>Fixed: Support to WPML in query string</li>\n        </ul>\n<h4>Version 1.2.5 - Released: Mar 12, 2015 </h4>\n<ul>\n    <li>Fixed: Plugin installation bug</li>\n</ul>\n<h4>Version 1.2.4 - Released: Mar 04, 2015 </h4>\n<ul>\n    <li>Updated: order of results</li>\n</ul>\n\n<h4>Version 1.2.3 - Released: Mar 02, 2015 </h4>\n<ul>\n    <li>Added: Support to WooCommerce 2.3.x</li>\n    <li>Added: Support to WPML</li>\n    <li>Added: Wordpress 4.1.1</li>\n    <li>Added: Filter for search fields</li>\n    <li>Added: Category Filter</li>\n    <li>Updated: Performance improvement when the research by sku is checked</li>\n	<li>Updated: Plugin Core Framework</li>\n</ul>\n\n<h4>Version 1.2.2 - Released: Feb 12, 2015 </h4>\n<ul>\n   <li>Added: Support to WooCommerce 2.3.x</li>\n   <li>Fixed: Sku research in variation products</li>\n   <li>Fixed: Licence Activation issue</li>\n   <li>Updated: Plugin Core Framework</li>\n</ul>\n<h4>Version 1.2.1 - Released: Feb 06, 2015 </h4>\n<ul>\n   <li>Added: Option to search or not in the excerpt</li>\n   <li>Added: Option to search or not in the content</li>\n   <li>Updated: Plugin Core Framework</li>\n   <li>Fixed: Search query string</li>\n</ul>\n\n<h4>Version 1.2 - Released: Jan 29, 2015 </h4>\n\n<ul>\n   <li>Updated: Plugin Core Framework</li>\n</ul>\n\n<h4>Version 1.0 - Released: Jan 13, 2015 </h4>\n\n<ul>\n   <li>Initial Release</li>\n</ul>\n\n    ";s:7:"package";N;s:6:"plugin";s:51:"yith-woocommerce-ajax-search-premium-1.3.8/init.php";}}s:12:"translations";a:0:{}s:9:"no_update";a:20:{s:19:"akismet/akismet.php";O:8:"stdClass":6:{s:2:"id";s:2:"15";s:4:"slug";s:7:"akismet";s:6:"plugin";s:19:"akismet/akismet.php";s:11:"new_version";s:3:"3.2";s:3:"url";s:38:"https://wordpress.org/plugins/akismet/";s:7:"package";s:54:"https://downloads.wordpress.org/plugin/akismet.3.2.zip";}s:64:"awesome-widgets-for-siteorigin-page-builder/widget_activator.php";O:8:"stdClass":6:{s:2:"id";s:5:"70222";s:4:"slug";s:43:"awesome-widgets-for-siteorigin-page-builder";s:6:"plugin";s:64:"awesome-widgets-for-siteorigin-page-builder/widget_activator.php";s:11:"new_version";s:3:"1.4";s:3:"url";s:74:"https://wordpress.org/plugins/awesome-widgets-for-siteorigin-page-builder/";s:7:"package"